import React from "react";
import DOH from "./DOH"
function App(prop){
	
	return (
	
	<div className='container'>
	<div className='container_img'>
	<img src={prop.Hdata[0].IS} />
	</div>
	<div className='container_detail'>
	<h1 className="hotel_name">{prop.Hdata[0].HN}</h1>
	<h1 className="hotel_prize" >{prop.Hdata[0].HP}</h1>
	
	</div>
	
	</div>
	
	)
}
export default App;
